import React from "react";
import { Card, Col, Row } from "reactstrap";

const Reports = () => {
  return (
    <div className="page-content">
      <p>generate a Report</p>
      <Card>
        <Row>
          <Col md={3}>
            <p>Select your Report type:</p>
          </Col>
          <Col md={3}></Col>
          <Col md={3}></Col>
          <Col md={3}></Col>
        </Row>

        <p></p>
      </Card>
    </div>
  );
};

export default Reports;
